import React, { useState } from 'react';
import sibinImage from '../assets/sibin.jpg';

const Header = ({ onToggleTheme, theme }) => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  const closeMobileMenu = () => {
    setIsMobileMenuOpen(false);
  };

  const handleNavClick = (sectionId) => {
    closeMobileMenu();
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <>
      <header>
        <div className="brand">
          <img src={sibinImage} alt="Profile" className="nav-photo" />
          <h1>SIBIN K S</h1>
        </div>
        
        {/* Desktop Navigation */}
        <nav>
          <a href="#hero">Home</a>
          <a href="#about">About</a>
          <a href="#skills">Skills</a>
          <a href="#experience">Experience</a>
          <a href="#projects">Projects</a>
          <a href="#education">Education</a>
          <a href="#contact">Contact</a>
          <a href="#certificates">Certificates</a>
          <button 
            onClick={onToggleTheme} 
            style={{
              background: 'none',
              border: 'none',
              color: 'var(--primary)',
              fontSize: '1.3rem',
              marginLeft: 18,
              cursor: 'pointer',
              transition: 'color 0.3s',
              outline: 'none',
              verticalAlign: 'middle'
            }}
            aria-label="Toggle dark/light mode"
            title={theme === 'dark' ? 'Switch to light mode' : 'Switch to dark mode'}
          >
            <i className={theme === 'dark' ? 'fas fa-sun' : 'fas fa-moon'}></i>
          </button>
        </nav>

        {/* Mobile Hamburger Menu */}
        <div 
          className={`hamburger-menu ${isMobileMenuOpen ? 'active' : ''}`}
          onClick={toggleMobileMenu}
        >
          <span></span>
          <span></span>
          <span></span>
        </div>
      </header>

      {/* Mobile Navigation Overlay */}
      <div className={`mobile-nav ${isMobileMenuOpen ? 'active' : ''}`}>
        <button className="mobile-nav-close" onClick={closeMobileMenu}>
          Ã—
        </button>
        <a onClick={() => handleNavClick('hero')}>Home</a>
        <a onClick={() => handleNavClick('about')}>About</a>
        <a onClick={() => handleNavClick('skills')}>Skills</a>
        <a onClick={() => handleNavClick('experience')}>Experience</a>
        <a onClick={() => handleNavClick('projects')}>Projects</a>
        <a onClick={() => handleNavClick('education')}>Education</a>
        <a onClick={() => handleNavClick('contact')}>Contact</a>
        <a onClick={() => handleNavClick('certificates')}>Certificates</a>
        <button 
          onClick={() => {
            onToggleTheme();
            closeMobileMenu();
          }}
          style={{
            background: 'none',
            border: 'none',
            color: 'var(--text-main)',
            fontSize: '1.2rem',
            padding: '15px 30px',
            width: '100%',
            textAlign: 'left',
            cursor: 'pointer',
            transition: 'all 0.3s ease',
            borderBottom: '1px solid rgba(148, 163, 184, 0.1)'
          }}
          aria-label="Toggle dark/light mode"
        >
          <i className={theme === 'dark' ? 'fas fa-sun' : 'fas fa-moon'}></i>
          {' '}{theme === 'dark' ? 'Light Mode' : 'Dark Mode'}
        </button>
      </div>
    </>
  );
};

export default Header;
